class CustomerPage extends React.Component {


    render() {
        return (
            <div className="customerContainer">
                <img className="customerBackground"  src="/static/bmw.png"/>
                <div className="customerContent">
                    <button className="rotateButtonPrev"/>
                    <button className="rotateButtonNext"/>
                </div>
            </div>
        );
    }
}

export default CustomerPage;
